  false,\n\t\"url\": null,\n\t\"notes\": \"The objective of this survey is to monitor
  waterfowl brood use and number in association with water management and drawdowns
  of impoundments (including associated practices such as moist soil management, disking,
  and burning).  Efforts will include counting the number of chicks per brood and
  number of broods per water body as well as documenting water depth.  Shorebirds
  and additional waterbirds will also be counted in conjunction with broods.\",\n\t\"license_title\":
